import React, { Fragment } from "react";
import "../../App.css";
import Header from "../../Components/Header/Header";
import DoctorIntro from "../../Components/DoctorIntro/DoctorIntro";
import DoctorBlock from "../../Components/DoctorBlock/DoctorBlock";
import TimeDropdown from "../../Components/TimeDropdown/TimeDropdown";
import DropdownContainer from "../../Components/DropdownContainer/DropdownContainer";

const AppointmentPage = (props, state) => {
  state = {
    doctor_id: null,
  };
  const { doctor_id, user, doctor_name } = props.location.state;
  console.log("doctor id", doctor_id);
  console.log("user", user);

  //Set state
  if (user === "patient") {
    return (
      <div className="App">
        <Header portal="Appointment Management"></Header>
        <DropdownContainer
          doctor_id={doctor_id}
          user={user}
          doctor_name={doctor_name}
        ></DropdownContainer>
        {/* <button>Log in as Patient</button>
                <button>Log in as Docotr</button> */}
      </div>
    );
  } else {
    return <Fragment></Fragment>;
  }
};

export default AppointmentPage;
